          <MainNav active={activeNav} />
        </div>
        <div className='secondCol'>
          <ArchiveSearch />
        </div>
        <div className='thirdCol'>
          <img src='assets/img/map.jpg' />
        </div>

        {/* <h1>Hello, world!hhhh</h1>
    <Link href={"/reset"}>reset page</Link> */}
        {/* <HomepageCounter /> */}
      </div>
    </Container>
  );
}
